(3572, 'stores', 6, 'gdpr/cookie/bar/content', 'Prin utilizarea magazinului noastru, sunteti de acord cu utilizarea cookie-urilor. Cookie-urile ne ajuta sa va oferim servicii mai bune si produse conform cerintelor dumneavoastra. Pentru a afla mai multe clic <a href=\"/folosim-cookie-uri\">AICI</a>', '2021-05-01 06:33:38'),
(3573, 'stores', 2, 'gdpr/cookie/bar/content', 'Prin utilizarea magazinului noastru, sunteti de acord cu utilizarea cookie-urilor. Cookie-urile ne ajuta sa va oferim servicii mai bune si produse conform cerintelor dumneavoastra. Pentru a afla mai multe clic <a href=\"/folosim-cookie-uri\">AICI</a>', '2021-05-02 06:24:40'),
(3574, 'stores', 6, 'gdpr/cookie/modal/content', 'Acest site foloseste cookie-uri pentru a va imbunatati experienta in timp ce navigati prin site. Dintre aceste cookie-uri, cookie-urile clasificate ca fiind necesare sunt stocate in browserul dvs., deoarece sant esentiale pentru functionalitatile de baza ale site-ului. De asemenea, folosim cookie-uri terte care ne ajuta sa analizam si sa intelegem modul in care utilizati acest site. Aceste cookie-uri vor fi stocate in browser-ul dvs. numai cu acordul dumneavoastra. De asemenea, aveti optiunea de a renunta la aceste cookie-uri. Renuntarea la unele dintre aceste cookie-uri poate avea un efect asupra experienttei dvs. de navigare.', '2021-04-29 07:37:01'),
